  base: *id014
  body: "LSM9DS1's orientation hasn't been correctly set. Since we've had the long-awaited\
    \ boilerplate code in master for compass rotations, it's gotten easier to spot\
    \ a bug which hadn't popped up as often as to notice it. That's why it's been\
    \ neglected for such a long time. LSM9DS1 worked correctly with offsets calculated\
    \ on board but yielded Inconsistent compasses error if Live calibration was used.\r\
    \n\r\nArduCopter 3.4 doesn't have new infrusture for compass orientation setting\
    \ in ```::probe()```. That's why we fix the error by moving rotation to the place\
    \ it should've always been."
